const EmbeddedAppsUtils = {};

/**
 * parse the relevant values that we care about
 * @param {Object} embeddedApps
 * @returns {Object} parsedObject - parsed embedded apps object
 */
EmbeddedAppsUtils.parse = (embeddedApps) => {
  const parsedEmbeddedApps = embeddedApps && [...embeddedApps];

  return parsedEmbeddedApps;
};

export default EmbeddedAppsUtils;
